import React, { Component } from 'react';
import TopList from '../TopList/TopList';
import {Switch, Route} from 'react-router-dom';


const topListItems = [
  {link: '/propjects/my', text: 'Мои проекты'},
  {link: '/propjects/other', text: 'Чужие проекты'},
  {link: '/snippets', text: 'Сниппеты'},
  {link: '/components', text: 'Компоненты'},
];

class Home extends Component {
  render() {
    return (
      <div className="content hidden-side">
        <TopList items={topListItems}/>

        <Switch>
          <Route path="/propjects/my"></Route>
        </Switch>

      </div>

      
    );
  }
}

export default Home;
